package sa.test;

import static org.junit.Assert.assertEquals;
import static org.junit.Assert.assertFalse;
import static org.junit.Assert.assertTrue;

import java.util.Arrays;
import java.util.List;

import org.junit.BeforeClass;
import org.junit.Test;

import gradescope.grader.GradedTest;
import ledger.LoggedTest;
import sa.SalesAnalytics;

public class AnalyticsTest extends LoggedTest
{
	@Test
    @GradedTest(name="Test Single Examples", max_score=10)
	public void testSingle()
	{
		SalesAnalytics uut = new SalesAnalytics();
		assertTrue(uut.isSimilar("aaa", "aaa", 3));
		assertTrue(uut.isSimilar("bbb", "ccc", 3));
		assertTrue(uut.isSimilar("abcde", "aaabb", 3));
		assertFalse(uut.isSimilar("a", "aaaaa", 3));
		assertFalse(uut.isSimilar("badberf", "dwarwarewatyaeawra", 3));
	}
	
	@Test
    @GradedTest(name="Test Multiple Option", max_score=20)
	public void testSeveral()
	{
		SalesAnalytics uut = new SalesAnalytics();
		List<String> one = Arrays.asList(
				"", 
				"", 
				"", 
				"", 
				""); 
		List<String> two = Arrays.asList(
				"", 
				"", 
				"", 
				"", 
				"");
		assertEquals(Arrays.asList(true, true, false, true, false), uut.getSimilar(two, one, 3));

		one = Arrays.asList(
		"",
		"",
		"",
		"",
		"");

		
		two = Arrays.asList(
		"",
		"",
		"",
		"",
		"");
		
		assertEquals(Arrays.asList(true, false, true, true, true), uut.getSimilar(two, one, 3));
		
	}

	private static final String CODE_FILE= "src/sa/SalesAnalytics";
	@BeforeClass
	public static void grabCode()
	{
		LoggedTest.grabCode(CODE_FILE);
	}
}